// src/pages/Profile.jsx
import React, { useEffect, useState } from "react";
import Navbar from "../components/Navbar";
import Sidebar from "../components/Sidebar";
import API from "../api";

export default function Profile() {
  const role = localStorage.getItem("role");
  const [data, setData] = useState([]);
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    if (!role) {
      window.location.href = "/login";
      return;
    }

    if (role === "admin") {
      loadAdminData();
    } else {
      loadStudentData();
    }
  }, [role]);

  const loadAdminData = async () => {
    try {
      const res = await API.get("/quiz");
      const quizzes = res.data;

      const detailed = await Promise.all(
        quizzes.map(async (quiz) => {
          try {
            const subRes = await API.get(`/quiz/${quiz._id}/submissions`);
            const subs = subRes.data || [];
            const count = subs.length;
            const avg = count > 0 
              ? (subs.reduce((s, sub) => s + sub.score, 0) / count).toFixed(1)
              : "N/A";
            return { ...quiz, participants: count, averageScore: avg, submissions: subs };
          } catch {
            return { ...quiz, participants: 0, averageScore: "N/A", submissions: [] };
          }
        })
      );

      setData(detailed);
    } catch (err) {
      console.error(err);
    } finally {
      setLoading(false);
    }
  };

  const loadStudentData = async () => {
    try {
      const res = await API.get("/quiz/user/submissions");
      setData(res.data || []);
    } catch (err) {
      console.error(err);
    } finally {
      setLoading(false);
    }
  };

  if (loading) return <h2 style={{ padding: 40 }}>Loading Profile...</h2>;

  return (
    <>
      <Navbar />
      <div className="container-row">
        <Sidebar />
        <div className="content">
          <div className="card">
            <h2>
              {role === "admin" ? "Admin Profile - Quiz Analytics" : "My Quiz History"}
            </h2>

            {data.length === 0 ? (
              <p>No data available</p>
            ) : (
              <div style={{ marginTop: 20 }}>
                {role === "admin" ? (
                  // ADMIN VIEW
                  data.map((quiz) => (
                    <div key={quiz._id} style={{ padding: 15, marginBottom: 15, border: "1px solid #555", borderRadius: 8 }}>
                      <h3>{quiz.title}</h3>
                      <p><strong>Code:</strong> {quiz.code}</p>
                      <p><strong>Total Questions:</strong> {quiz.questions.length}</p>
                      <p><strong>Participants:</strong> {quiz.participants}</p>
                      <p><strong>Average Score:</strong> {quiz.averageScore}</p>
                      {quiz.submissions.length > 0 && (
                        <div>
                          <strong>Top Performers:</strong>
                          <ul>
                            {quiz.submissions
                              .sort((a, b) => b.score - a.score)
                              .slice(0, 5)
                              .map((s, i) => (
                                <li key={i}>
                                  {s.student?.name || "Anonymous"} â†’ <strong>{s.score}</strong>
                                </li>
                              ))}
                          </ul>
                        </div>
                      )}
                    </div>
                  ))
                ) : (
                  // STUDENT VIEW
                  data.map((sub, i) => (
                    <div key={i} style={{ padding: 15, marginBottom: 15, border: "1px solid #555", borderRadius: 8 }}>
                      <h3>{sub.quiz?.title || "Unknown Quiz"}</h3>
                      <p><strong>Code:</strong> {sub.quiz?.code || "N/A"}</p>
                      <p><strong>Your Score:</strong> {sub.score} / {sub.quiz?.questions?.length || "?"}</p>
                      <p><strong>Date:</strong> {new Date(sub.createdAt).toLocaleDateString()}</p>
                    </div>
                  ))
                )}
              </div>
            )}
          </div>
        </div>
      </div>
    </>
  );
}
